<p>由于 Lucene 提供的 API 操作起来非常繁琐, 需要编写大量的代码, Elasticsearch 对 Lucene 进行了封装与优化, 并提供了 REST 风格的操作接口, 开箱即用, 很大程度上方便了开发人员的使用</p>
